  12,\n\t\"tags\": [],\n\t\"title\": \"Effects of ocean acidification on fishery yields
  and profits of red king crab in Bristol Bay from model studies (NCEI Accession 0127395)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 9,\n\t\t\"recent\": 2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-09-26T22:18:32.295342\",\n\t\"name\": \"effects-of-ocean-acidification-on-fishery-yields-and-profits-of-red-king-crab-in-bristol-bay-fr\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This archival package contains model output
  data that were collected to examine the impact of ocean acidification on fishery
  yields and profits of red king crab in Bristol Bay. A stage-structured pre-recruit
  model was developed to capture hypotheses regarding the impact of ocean acidification
  on the survival of pre-recruit crab. The model was parameterized using life history
  and survival data for red king crab (Paralithodes camtschaticus) derived from experiments
  conducted at the National Marine Fisheries Service Kodiak laboratory. A parameterized
  pre-recruit model was linked to a post-recruit population dynamics model for adult
  male red king crab in Bristol Bay, Alaska that included commercial fishery harvest.
  This coupled population dynamics model was integrated with a bioeconomic model of
  commercial fishing sector profits to forecast how the impacts of ocean acidification
  on the survival of pre-recruit red king crab will affect yields and profits for
  the Bristol Bay red king crab fishery fora scenario that includes future ocean pH
  levels predictions. Expected yields and profits were projected to decline over the
  next 50-100 years in this scenario given reductions in pre-recruit survival due
  todecreasing ocean pH levels over time. The target fishing mortality used to provide
  management advice based on the current harvest policy for Bristol Bay red king crab
  also declined over time in response todeclining survival rates. However, the impacts
  of ocean acidification due to reduced pre-recruit survivalon yield and profits are
  likely to be limited for the next 10-20 years, and its effects will likely be masked
  by natural variation in pre-recruit survival. This analysis is an initial step toward
  a fully integrated under-standing of the impact of ocean acidification on fishery
  yields and profits, and could be used to focus future research efforts.\",\n\t\"license_title\":
